import React, { Component } from "react";

class MyTrips extends Component {
  constructor(props) {
    super(props);
    this.state = {
      trips: null,
    };
  }

  componentDidMount() {
    fetch("http://localhost:8085/user/gettrips", {
      method: "get",
      headers: new Headers({
        Authorization: localStorage.jwtToken,
        "Content-Type": "application/json",
      }),
    })
      .then((response) => response.json())
      .then((mytrips) => {
        console.log(mytrips);
        this.setState({
          trips: mytrips,
        });
      });
  }
  render() {
    const { trips } = this.state;
    const isLoading = trips === null;

    return (
      <div>
        <h2 className="text-center text-white">Employees List</h2>
        <br></br>
        <div className="row">
          <table className="table table-striped table-bordered text-white text-center border border-dark bg-dark">
            <thead>
              <tr>
                <th> T.No</th>
                <th> Description</th>
                <th> Destination</th>
                <th> Budget</th>
                <th> Group Size</th>
                <th> Date</th>
                <th> Actions</th>
              </tr>
            </thead>
            <tbody>
              {isLoading ? (
                <tr>
                  <td colSpan={7} className="uk-text-center text-white">
                    <em className="uk-text-muted text-white">
                      No trips to display
                    </em>
                  </td>
                </tr>
              ) : (
                this.state.trips.map((mtrip) => (
                  <tr key={mtrip.tripId}>
                    <td>1</td>
                    <td> {mtrip.description} </td>
                    <td> {mtrip.destination}</td>
                    <td> {mtrip.tripBudget}</td>
                    <td> {mtrip.groupSize}</td>
                    <td> {mtrip.tripDate} </td>
                    <td>
                      <button
                        //onClick={() => this.editEmployee(employee.id)}
                        className="btn btn-info"
                      >
                        Update{" "}
                      </button>
                      <button
                        style={{ marginLeft: "10px" }}
                        //onClick={() => this.deleteEmployee(employee.id)}
                        className="btn btn-danger"
                      >
                        Delete{" "}
                      </button>
                      <button
                        style={{ marginLeft: "10px" }}
                        // onClick={() => this.viewEmployee(employee.id)}
                        className="btn btn-info"
                      >
                        View{" "}
                      </button>
                    </td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default MyTrips;
